import Presentationpageadmin from "../components/Presentationpageadmin";
import Navigationadmin from "../components/Navigationadmin";

const Presentationadmin = () => {
  return (
    <div>
      <Logo />
      <Navigationadmin />
      <Presentationpageadmin />
    </div>
  );
};


export default Presentationadmin;
